let features = [];
const source = new ol.source.Vector({});

const clusterSource = new ol.source.Cluster({
    distance: 30,
    source: source
});

let styleCache = {};
const vector = new ol.layer.Vector({
    source: clusterSource,
    style: function (feature) {
        const size = feature.get('features').length;
        if (size === 1) {
            return feature.get('features')[0].getStyle();
        }
        let style = styleCache[size];
        if (!style) {
            style = new ol.style.Style({
                image: new ol.style.Circle({
                    radius: 10,
                    stroke: new ol.style.Stroke({
                        color: '#fff'
                    }),
                    fill: new ol.style.Fill({
                        color: '#3399CC'
                    })
                }),
                text: new ol.style.Text({
                    text: size.toString(),
                    fill: new ol.style.Fill({
                        color: '#fff'
                    })
                })
            });
            styleCache[size] = style;
        }
        return style;
    }
});


const map = new ol.Map({
    target: 'map',
    layers: [
        new ol.layer.Tile({
            source: new ol.source.XYZ({
                url: 'http://mt0.google.com/vt/lyrs=m&hl=en&x={x}&y={y}&z={z}'
            })
        }),
        vector
    ],
    view: new ol.View({
        center: ol.proj.fromLonLat([11.888854, 45.449484]),
        zoom: 18
    })
});

let dblClickInteraction;
// find DoubleClickZoom interaction
map.getInteractions().getArray().forEach(function (interaction) {
    if (interaction instanceof ol.interaction.DoubleClickZoom) {
        dblClickInteraction = interaction;
    }
});
// remove from map
if (dblClickInteraction) {
    map.removeInteraction(dblClickInteraction);
}


$.ajax({
    url: '/map',
    type: 'GET',
    data: {
        'bins': 100
    },
    dataType: 'json',
    success: function (data) {
        console.debug(data);
        if (data && 'bins' in data && data['bins'].length) {
            data['bins'].forEach(f => {
                const iconFeature = new ol.Feature({
                    geometry: new ol.geom.Point(ol.proj.fromLonLat([f['longitude'], f['latitude']])),
                    name: 'Null Island'
                });
                const typeImage = f['typeImage'] === 0 ? 'png' : 'svg';
                const iconStyle = new ol.style.Style({
                    image: new ol.style.Icon({
                        src: `data:image/${typeImage};base64,${f['b64']}`,
                        scale: 0.1
                    })
                });
                iconFeature.setStyle(iconStyle);
                features.push(iconFeature);
            });
            vector.getSource().getSource().addFeatures(features);
        }


    },
    error: function (request, error) {
        console.error("Request: " + JSON.stringify(request));
    }
});